import { SettingsCellRounded } from '@material-ui/icons'
import { useState } from 'react'
import StyledButton from './styledComponents/StyledButton.js'

const Home = ({initialcount}) => {
    const [count, setCount] = useState({initialcount})
    return (
        <div>
            <h1>Home Page</h1>
            <StyledButton onClick={ ()=>setCount(count+1) }>
                Count
            </StyledButton>
            {count}
        </div>
    )
}

export default Home
